import React from 'react';
import Link from 'next/link';

const Pesquisa = () => {
  return (
    <div>
      <h1>Críticas e Sugestões</h1>
      <p>O restaurante X sempre buscar atender melhor seus clientes.
Por isso, estamos sempre abertos a ouvir sua opinião</p>
      <div>
        <Link href="/">
          <a>Home</a>
        </Link>
      </div>
    </div>
  )
};

export default Pesquisa;
